import notifications from "../utils/notifications.js";

function NotificationList () {
    return (
        <div>
            <div>
                {notifications.map((e) =>  <Noti src={e.picture} alt="img" /> )}
            </div>
        </div>
    ) 
}

export default NotificationList;
